<p><code>Error: Schema must contain uniquely named types but contains multiple types named &quot;Constellation&quot;.</code></p>
<p>The error states that ObjectTypes <code>Constellation</code> and <code>Affix</code> are not unique. These are both <code>ObjectTypes</code> that represent the type for a field:</p>
