MongoDB query on specific child<p>I've got a document that contains an array of elements. I'd like to find specific entries in that document.</p>
<p>Example entry 1:</p>
<pre class="lang-json prettyprint-override"><code>{
  &quot;c&quot;: [
    {
      &quot;k&quot;: &quot;1&quot;,
      &quot;v&quot;: &quot;1&quot;,
    },
    {
      &quot;k&quot;: &quot;2&quot;,
      &quot;v&quot;: &quot;2&quot;,
    },
  ]
}
</code></pre>
<p>Example entry 2:</p>
<pre class="lang-json prettyprint-override"><code>{
  &quot;c&quot;: [
    {
      &quot;k&quot;: &quot;1&quot;,
      &quot;v&quot;: &quot;2&quot;,
    },
    {
      &quot;k&quot;: &quot;2&quot;,
      &quot;v&quot;: &quot;1&quot;,
    },
  ]
}
</code></pre>
<p>I'd like to find all entries that have a <code>k</code> that is <code>1</code>, and a matching <code>v</code> that is <code>1</code> (here, the first entry matches, but the second one doesn't, because the <code>v</code> that has the value of <code>1</code> is not the same object as the <code>k</code> valued <code>1</code>).</p>
<p>So far, I found the query:</p>
<pre class="lang-json prettyprint-override"><code>{
  &quot;$and&quot;: [
    {&quot;c.k&quot;: &quot;1&quot;},
    {&quot;c.v&quot;: &quot;1&quot;}
  ]
}
</code></pre>
<p>However, that returns both entries, not just the first one. Is there a way to tell MongoDB that both constraints should apply to the same item in the array, and not just to any item?</p>

